		<p style="text-align: justify;"><span style="font-weight: 400;">C&ugrave;ng với những biện ph&aacute;p tr&ecirc;n đ&acirc;y khi ruộng l&uacute;a c&oacute; biểu hiện bị bệnh c&oacute; thể sử dụng một trong c&aacute;c loại thuốc như: Kacie 250EC, Golcol 20SL, Supercin 20EC/40EC/80EC, Carbenzim 500FL, Tilt Super 300EC, Viroval 50BTN, Workup 9SL... để phun xịt. Về liều lượng v&agrave; c&aacute;ch sử dụng c&aacute;c bạn nhớ đọc kỹ hướng dẫn của nh&agrave; sản xuất c&oacute; in sẵn tr&ecirc;n bao b&igrave;.</span></p>
