		<p><span style="font-weight: 400;"> </span><span style="font-weight: 400;">Với sự hiện diện của hoạt chất k&eacute;p. </span><strong>Hexalazole 300SC</strong><span style="font-weight: 400;">&nbsp; vừa&nbsp; ph&ograve;ng trị tốt bệnh kh&ocirc; vằn hại l&uacute;a c&ograve;n hiệu lực mạnh với bệnh </span><strong>đạo &ocirc;n</strong><span style="font-weight: 400;"> hại l&uacute;a. Rất tiện lợi trong sử dụng, gi&uacute;p b&agrave; con n&ocirc;ng d&acirc;n c&ugrave;ng một l&uacute;c quản l&yacute; tốt hai bệnh phổ biến ( </span><strong>đạo &ocirc;n, đốm vằn</strong><span style="font-weight: 400;"> ) trong suốt qu&aacute; tr&igrave;nh sinh trưởng v&agrave; ph&aacute;t triển của c&acirc;y l&uacute;a.</span></p>
